import React from "react";
import { connect } from "react-redux";
import PropTypes from "prop-types";
import { Animated } from "react-animated-css";
import Toolbar from "@material-ui/core/Toolbar";
import Button from "@material-ui/core/Button";
import { getApod, getMrp } from "./actions/formActions/actions";
import { withStyles } from "@material-ui/core/styles";
import Card from "@material-ui/core/Card";
import CardActionArea from "@material-ui/core/CardActionArea";
import CardContent from "@material-ui/core/CardContent";
import CardMedia from "@material-ui/core/CardMedia";
import Typography from "@material-ui/core/Typography";
import "./App.css";

const styles = {
  body: {
    display: "grid",
    gridTemplateColumns: "1fr 1fr 1fr",
    gridColumnGap: 50,
    //display: "flex",
    //flexWrap: "wrap",
    justifyItems: "center",
    position: "relative",
    bottom: 100,
    opacity: "0.8"
  },
  card: {
    maxWidth: 300,
    maxHeight: 250
  },
  media: {
    objectFit: "cover"
  },
  text: {
    fontFamily: "Quicksand",
    fontWeight: "bold"
  },
  failure: {
    color: "white"
  }
};

function App(props) {
  const { classes } = props;

  return (
    <React.Fragment>
      <div className="root">
        <Toolbar>
          <Button id="buttons" href="about">
            About
          </Button>
          <Button id="buttons" href="contact">
            Contact
          </Button>
        </Toolbar>
      </div>

      <div className="showCase">
        <Animated
          animationIn="fadeInRight"
          animationOut="fadeOut"
          isVisible={true}
        >
          <h1>Universa Localis</h1>
        </Animated>
        <p>The whole universe on your screen</p>
      </div>
      <img
        className="icons"
        src="https://upload.wikimedia.org/wikipedia/commons/thumb/e/e5/NASA_logo.svg/2000px-NASA_logo.svg.png"
        alt="Nasa"
      />

      <div className={classes.body}>
        <Card className={classes.card}>
          <CardActionArea>
            <CardMedia
              component="img"
              alt=""
              className={classes.media}
              height="140"
              image="https://apod.nasa.gov/apod/image/1812/GeminidAurora_Hansen1_960.jpg"
              title="Astronomy Picture"
              onClick={props.getApod}
            />
            <CardContent>
              <Typography
                className={classes.text}
                gutterBottom
                variant="h5"
                component="h2"
              >
                APOD
              </Typography>
              <Typography className={classes.text} component="p">
                Get the astronomy picture of the day, everyday!
              </Typography>
            </CardContent>
          </CardActionArea>
        </Card>

        <Card className={classes.card}>
          <CardActionArea>
            <a href="mrp">
              <CardMedia
                component="img"
                alt=""
                className={classes.media}
                height="140"
                image="http://www.digitaltrends.com/wp-content/uploads/2012/08/curiosity-rover-lead.jpg"
                title="Mars Rover Photos"
              />
            </a>
            <CardContent>
              <Typography
                className={classes.text}
                gutterBottom
                variant="h5"
                component="h2"
              >
                Mars Rover Photos
              </Typography>
              <Typography className={classes.text} component="p">
                Get the photos taken by the rovers on Mars!
              </Typography>
            </CardContent>
          </CardActionArea>
        </Card>

        <Card className={classes.card}>
          <CardActionArea>
            <a href="ivl">
              <CardMedia
                component="img"
                alt=""
                className={classes.media}
                height="140"
                image="https://images-assets.nasa.gov/image/as11-40-5874/as11-40-5874~orig.jpg"
                title="NASA IVL"
              />
            </a>
            <CardContent>
              <Typography
                className={classes.text}
                gutterBottom
                variant="h5"
                component="h2"
              >
                NASA IVL
              </Typography>
              <Typography className={classes.text} component="p">
                View media from the NASA Image and Video Library!
              </Typography>
            </CardContent>
          </CardActionArea>
        </Card>
      </div>
    </React.Fragment>
  );
}

const mapDispatchToProps = {
  getApod: getApod,
  getMrp: getMrp
};

App.propTypes = {
  classes: PropTypes.object.isRequired
};

const withstyles = withStyles(styles)(App);
const AppConnected = connect(
  null,
  mapDispatchToProps
)(withstyles);
export default AppConnected;
